import React, { useEffect } from "react";
import { useSelector } from "react-redux";
import HeadCell from "./HeadCell/index";

const TableHead = () => {
   const columns = useSelector((state) => state.matrix.settings.columns);
   let heads = [];
   useEffect(() => {
      for (let i = 0; i < columns; i++) {
         if (i === 0) {
            heads.push("");
         } else {
            heads.push("col " + i);
         }
      }
      return heads.map((headValue, index) => (
         <HeadCell key={index} value={headValue} />
      ));
   }, []);
   console.log(heads);


   return (
      <thead>
         <tr>{heads}</tr>
      </thead>
   );
};

export default TableHead;
